export const SET_USER = "SET_USER";
export const LOGOUT = "LOGOUT";


 const  setUser = (userObject) => ({  
    type:'SET_USER',
    payload:userObject
}); 
 const logOut = () => ({  
    type:LOGOUT
}); 

export default {
    setUser,
    logOut
}
